import {
    TableContainer,
    Table,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Box,
    CircularProgress, makeStyles
} from "@material-ui/core";
import useAxios from "axios-hooks";


const useStyles = makeStyles(()=>({
    tableBorder :{
        border : "gray 5px solid",
        marginTop:10
    },
}));

const CustomerListPage = () =>{
    const classes = useStyles();

    const [{data, loading, error}] = useAxios("http://localhost:8080/customer/list")
    if(loading){
        return(
            <Box sx={{display:'flex'}}>
                <CircularProgress/>
            </Box>)
    }
    if(error){
        return (
            <Box sx={{display:'flex'}}>
                Error!!: {error.message}
            </Box>
        )
    }


    return (
        <TableContainer>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell><b>DB_Id</b> </TableCell>
                        <TableCell><b>First Name</b> </TableCell>
                        <TableCell><b>Middle Name</b> </TableCell>
                        <TableCell><b>Last Name</b> </TableCell>
                        <TableCell><b>Email</b> </TableCell>
                        <TableCell><b>Phone Number</b> </TableCell>
                        <TableCell><b>Items Purchased</b> </TableCell>
                        <TableCell><b>Date Purchased</b> </TableCell>

                    </TableRow>

                </TableHead>

                <TableBody>
                    {data.map((row)=>{
                        return (
                            <TableRow>
                                <TableCell>{row.id}</TableCell>
                                <TableCell>{row.firstName}</TableCell>
                                <TableCell>{row.middleName}</TableCell>
                                <TableCell>{row.lastName}</TableCell>
                                <TableCell>{row.email}</TableCell>
                                <TableCell>{row.phoneNumber}</TableCell>
                                <TableCell>{row.itemsPurchased}</TableCell>
                                <TableCell>{row.datePurchased}</TableCell>
                            </TableRow>
                        )
                    })}
                </TableBody>
            </Table>
        </TableContainer>
    )
}

export default CustomerListPage
